package es.caib.gestoli.logic.model;

import java.io.Serializable;
import java.util.Date;


public class QualitatProveidorRGSA implements Serializable {

	private static final long serialVersionUID = 1L;

	private Long id;
	private String nom;
	private Date caducitatRGSA;
	private QualitatProveidor proveidor;
	
	public QualitatProveidorRGSA() {
		super();
		// TODO Auto-generated constructor stub
	}

	public QualitatProveidorRGSA(Long id, String nom,
			QualitatProveidor proveidor) {
		super();
		this.id= id;
		this.nom= nom;
		this.caducitatRGSA = caducitatRGSA;
		this.proveidor = proveidor;
	}

	public Long getId() {
		return id;
	}

	public void setId(Long id) {
		this.id = id;
	}

	public String getNom() {
		return nom;
	}

	public void setNom(String nom) {
		this.nom = nom;
	}

	public Date getCaducitatRGSA() {
		return caducitatRGSA;
	}

	public void setCaducitatRGSA(Date caducitatRGSA) {
		this.caducitatRGSA = caducitatRGSA;
	}

	public QualitatProveidor getProveidor() {
		return proveidor;
	}

	public void setProveidor(QualitatProveidor proveidor) {
		this.proveidor = proveidor;
	}

}